review_text:
爱他美德版白金真够抢手的，调货甚至断货让人着急，只能看哪段有货就屯了，一共十罐，在考虑要不要用其他账号接着屯些&hellip;
目前孩子刚满六个月大，吃第二罐普通原味了，新品有机的原味和香蕉味（送了吸盘碗，挺实用的），普通的胡萝卜菠菜的也各屯一罐～
还有一对温感勺、六个大号奶嘴、指甲剪什么的，这几天来拍四单了～

